import React from 'react';

const Dashboard = () => {
  return (
    <div className="dashboard-title">
      <h2>Dashboard</h2>
      <div className="dashboard-container">
        <div className="dashboard-card">
          <h2>Card 1</h2>
          <p>Electric Bills</p>
        </div>
        <div className="dashboard-card">
          <h2>Card 2</h2>
          <p>Water Bill</p>
        </div>
        <div className="dashboard-card">
          <h2>Card 2</h2>
          <p>Internet Bill</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
